import React, { Component } from 'react';
import About from './about';
import HomePage from './homepage';
import Contact from './contact';
import {Link} from 'react-scroll';
import './navstyle.css';
import $ from 'jquery';

class Nav extends Component {

  componentDidMount = () => {
    $(document).ready(function() {
      $(window).scroll(function() {
        if ($(document).scrollTop() > 400) {
          console.log('hello');
          $(".navbar").addClass("test");
        } else {
           $(".navbar").removeClass("test");
    }
    });
  });
    }

  render(){
   return (
      <div className='navbar'>
  <nav 
  style={{backgroundColor:'transparent',marginTop:0}} className="navbar navbar-expand-sm fixed-top">
  <a class="navbar-brand" href="#">Anjali</a>
  <ul className="navbar-nav my-2 my-lg-0">
    <li className="nav-item">
       <Link
          activeClass="active"
          to="homepage"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='nav-link'>Home</span></Link>
    </li>
    <li className="nav-item">
       <Link
          activeClass="active"
          to="about"
          spy={true}
          smooth={true}
          offset={0}
          duration={500}
      ><span className='nav-link'>About</span></Link>
    </li>
    <li className="nav-item">
        <Link
          activeClass="active"
          to="resume"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='nav-link'>Resume</span></Link>
    </li>
     <li className="nav-item">
        <Link
          activeClass="active"
          to="portfolio"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='nav-link'>Portfolio</span></Link>
    </li>
    <li className="nav-item">
        <Link
          activeClass="active"
          to="contact"
          spy={true}
          smooth={true}
          offset={0}
          duration= {500}
      ><span className='nav-link'>Contact</span></Link>
    </li>
  </ul>
</nav>
  </div>
    );
  }
}

export default Nav;
